import React, { Component } from 'react';
import './App.css';

class App extends Component {
  componentDidMount(){
    const apiUrl = 'https://sometimes-maybe-flaky-api.gdshive.io/';
    fetch(apiUrl)
      .then((response) => response.json())
      .then((data) => console.log('This is your data', data));

  }
  render(){
    return (
        <div className="App">
        </div>
    );
  }
}

export default App;
